const $=document,navList=$.querySelector(".nav-list"),burgerMenu=$.querySelector(".burger-menu");let navOn=!1;burgerMenu.addEventListener("click",()=>{!1===navOn?(navOn=!0,burgerMenu.classList.add("change"),navList.classList.add("toggle")):(navOn=!1,burgerMenu.classList.remove("change"),navList.classList.remove("toggle"))});var swiper=new Swiper(".swiper",{effect:"coverflow",grabCursor:!0,centeredSlides:!0,slidesPerView:"auto",coverflowEffect:{rotate:10,stretch:0,depth:100,modifier:1,slideShadows:!0}});